<!DOCTYPE html>
<html lang="zh_cn">
<head>
    <meta charset="UTF-8">
    <title>滤镜示意</title>

    <meta name="csrf-token" content="{{ csrf_token() }}">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0,user-scalable=no">
    <link href="https://cdn.bootcss.com/weui/1.1.2/style/weui.css" rel="stylesheet">
    <link rel="stylesheet" href="//unpkg.com/iview/dist/styles/iview.css">
</head>
<body>
<div id="app">
    <div>
        <img v-bind:src="photo" width="300px" alt="">

        <p>选择生成方式和滤镜编码ID（1<=ptu<=32;1<=AILab<=65）</p>
        <radio-group v-model="type">
            <radio label="ptu"></radio>
            <radio label="AILab"></radio>
        </radio-group>

        <input-number :max="max" :min="1" v-model="id"></input-number>

        <i-button type="primary" v-on:click="confirm">生成</i-button>
    </div>

</div>
</body>
<script src="https://cdn.bootcss.com/vue/2.5.16/vue.js"></script>
<script src="https://cdn.bootcss.com/axios/0.18.0/axios.js"></script>
<script src="//unpkg.com/iview/dist/iview.min.js"></script>
<script type="application/javascript">
    new Vue({
        el: '#app',
        data: {
            id: 1,
            type: 'AILab',
            photo: 'data:image/jpeg;base64,',
            photo1: 'data:image/jpeg;base64,',
        },
        computed: {
            max: function () {
                if (this.type === 'AILab') {
                    return 65;
                }
                return 32;
            }
        },
        methods: {
            confirm: function () {
                let that = this;
                axios.post('{{ url('api/img/filter') }}', {
                    id: that.id,
                    type: that.type,
                    photo: that.photo1
                }).then(function (res) {
                    let data = JSON.parse(res.data);
                    console.log(data)
                    if (data.ret === 0) {
                        that.photo = 'data:image/jpeg;base64,' + data.data.image;
                    } else {
                        alert(res.data)
                    }
                })
            }
        }
    })
</script>
</html>